import React from 'react';

export function Header({ names }) {
  const width = 100 / names.length;

  const style = {
    width: `${width}%`,
  };

  return (
    <div className="top">
      <ul className="top__list">
        {
                    names.map((name) => (
                      <div className="top__list-item" key={name} style={style}>
                        {name}
                      </div>
                    ))
                }
      </ul>
    </div>
  );
}
